import React from "react";
import "./Home.scss";
import Main from "../../Main";

const Home = () => {
  return (
    <Main pageTitle={"Home"}>
      <div className="container">
        <div className="hero">
          <h1>EarHealth</h1>
          <p>Specialist Ear care from the comfort of your own home.</p>
          <button>Book Your Appointment</button>
          <p>Contact us on <a href="tel:+">+44 (0) 333 242 2827</a></p>
        </div>
      </div>
    </Main>
  );
};

export default Home;
